import { useEffect, useState } from 'react';
import { endPoints, getVideoList } from './data/api/movie';

interface Video {
  backdrop_path: string
  first_air_date: string
  genre_ids: number[]
  id: number
  origin_country: string[]
  original_languages: string
  original_name: string
  overview: string
  popularity: number
  poster_path: string
  vote_average: number
  vote_count: number
}

function App() {
  const [originals, setOriginals] = useState<Video[]>();

  useEffect(() => {
    getVideoList(endPoints.originals).then(({ data }) => setOriginals(data));
  }, []);

  return (<div />);
}

export default App;
